import * as React from 'react';
import Link from '@mui/material/Link';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Title from './Title';
import { Button } from '@mui/material';

function updateTransactionStatus(event, transaction) {
  event.preventDefault();
  transaction.accepted = !transaction.accepted 
}

function preventDefault(event) {
  event.preventDefault();
}

export default function Orders(props) {
  const { transactions } = props

  return (
    <React.Fragment>
      <Title>Recent Transactions</Title>
      <Table size="small">
        <TableHead>
          <TableRow>
            <TableCell>ID</TableCell>
            <TableCell>Payor</TableCell>
            <TableCell>Payee</TableCell>
            <TableCell>Employee</TableCell>
            <TableCell>Account Number</TableCell>
            <TableCell>Branch</TableCell>
            <TableCell align="center">Amount</TableCell>
            <TableCell align="right">Accepted</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {transactions.map((transaction) => (
            <TableRow key={transaction._id}>
              <TableCell>{transaction._id}</TableCell>
              <TableCell>{transaction.payorEIN}</TableCell>
              <TableCell>{transaction.payeeId}</TableCell>
              <TableCell>{transaction.employeeId}</TableCell>
              <TableCell>{transaction.accountNumber}</TableCell>
              <TableCell>{transaction.payeeId}</TableCell>
              <TableCell align="center">{`$${transaction.amount}`}</TableCell>
              <TableCell align="center">{transaction.accepted.toString()}</TableCell>
              <TableCell align="center">
                <Button
                  component="label"
                  variant="outlined"
                  sx={{ marginRight: "1rem" }}
                  onClick={(event) => {updateTransactionStatus(event, transaction)}}
                >
                  {transaction.accepted}
                </Button>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
      <Link color="primary" href="#" onClick={preventDefault} sx={{ mt: 3 }}>
        See more orders
      </Link>
    </React.Fragment>
  );
}
